/*
  Course: INT-499 Capstone in Information Technology
  Instructor: John Russel
  Joshua Coman
*/

// src/components/Navbar.js
import React from "react";
import { Link } from "react-router-dom";
import "./Navbar.css"; 

export default function Navbar() {
  return (
    <nav className="navbar">
      {/* Logo */}
      <div className="navbar-logo">StreamList</div>

      {/* Menu */}
      <ul className="navbar-menu">
        <li>
          <Link to="/" className="menu-link">
            <span className="material-icons">home</span> Home
          </Link>
        </li>
        <li>
          <Link to="/movies" className="menu-link">
            <span className="material-icons">movie</span> Movies
          </Link>
        </li>
        <li>
          <Link to="/about" className="menu-link">
            <span className="material-icons">info</span> About
          </Link>
        </li>
        <li>
          <Link to="/cart" className="menu-link">
            <span className="material-icons">shopping_cart</span> Cart
          </Link>
        </li>
      </ul>
    </nav>
  );
}
